-- Create Tables
USE spaces
GO
CREATE TABLE [Client] (
  id        int IDENTITY NOT NULL, 
  firstname varchar(50) NOT NULL, 
  lastname  varchar(50) NOT NULL, 
  email     varchar(100) NOT NULL, 
  phone     varchar(20) NOT NULL, 
  business  varchar(100) NULL, 
  institute varchar(100) NULL, 
  [address]   varchar(50) NOT NULL, 
  city      varchar(100) NOT NULL, 
  country   varchar(50) NOT NULL, 
  postcode  varchar(5) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Contract] (
  id                            int NOT NULL, 
  Clientid                      int NOT NULL, 
  SalesRepEmployeeProfileID		int NOT NULL, 
  signeddate                    date NOT NULL, 
  [status]                      varchar(10) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Data] (
  id          int IDENTITY NOT NULL, 
  Streamid    int NOT NULL, 
  Recordingid int NOT NULL, 
  [date]      date NOT NULL, 
  expires     date NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Data Received] (
  PlatinumGoldStandardSubscriptionid int NOT NULL, 
  Dataid                       int NOT NULL);
CREATE TABLE [Employee Profile] (
  id        int IDENTITY NOT NULL, 
  firstname varchar(50) NOT NULL, 
  lastname  varchar(50) NOT NULL, 
  email     varchar(100) NOT NULL, 
  phone     varchar(20) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Executive Admin] (
  EmployeeProfileid int NOT NULL, 
  PRIMARY KEY (EmployeeProfileid));
CREATE TABLE [Gold] (
  StandardSubscriptionid int NOT NULL, 
  StandardLevelsid       int NOT NULL, 
  Streamid               int NOT NULL, 
  PRIMARY KEY (StandardSubscriptionid));
CREATE TABLE [Levels] (
  id    int IDENTITY NOT NULL, 
  tier  varchar(25) NOT NULL, 
  price decimal(19, 0) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Maintenance Worker] (
  EmployeeProfileid                  int NOT NULL, 
  ExecutiveAdminEmployeeProfileid	int NOT NULL, 
  Zoneid                      int NOT NULL, 
  PRIMARY KEY (EmployeeProfileid));
CREATE TABLE [Platinum] (
  GoldStandardSubscriptionid int NOT NULL, 
  GoldStandardLevelsid       int NOT NULL, 
  PRIMARY KEY (GoldStandardSubscriptionid));
CREATE TABLE [Product] (
  id                 int IDENTITY NOT NULL, 
  Suppliersupplycode int NOT NULL, 
  [name]               varchar(50) NOT NULL, 
  price              decimal(19,0) NOT NULL, 
  [description]        varchar(200) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Recording] (
  id         int IDENTITY NOT NULL, 
  Streamid   int NOT NULL, 
  Sensorid   int NOT NULL, 
  video      image NOT NULL, 
  audio      image NOT NULL, 
  bodyimagry image NOT NULL, 
  [length]     time NOT NULL, 
  [size]     int NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Sales Rep] (
  EmployeeProfileid        int NOT NULL, 
  ExecutiveAdminEmployeeProfileid int NOT NULL, 
  PRIMARY KEY (EmployeeProfileid));
CREATE TABLE [Sensor] (
  id          int IDENTITY NOT NULL, 
  Zoneid      int NOT NULL, 
  coordinates varchar(20) NOT NULL, 
  lastserv    date NOT NULL, 
  nextserv    date NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Standard] (
  Subscriptionid int NOT NULL, 
  Levelsid       int NOT NULL, 
  Streamid       int NOT NULL, 
  PRIMARY KEY (Subscriptionid));
CREATE TABLE [Stream] (
  id       int IDENTITY NOT NULL, 
  Sensorid int NOT NULL,
  [date] datetime NOT NULL,
  [start]  time NOT NULL, 
  [end]    time NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Stream Schedule] (
  id int IDENTITY NOT NULL,
  Sensorid int NOT NULL, 
  Streamid int NOT NULL, 
  Clientid int NOT NULL, 
  [date]   date NOT NULL, 
  [time]     time(7) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Subscription] (
  id				int NOT NULL, 
  Contractid       int NOT NULL, 
  Levelsid         int NOT NULL, 
  discount         varchar(6) NOT NULL, 
  [status]           varchar(15) NOT NULL, 
  lastpay          date NOT NULL, 
  nextpay          date NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE [Super Platinum] (
  PlatinumGoldStandardSubscriptionid int NOT NULL, 
  Zoneid                             int NOT NULL, 
  PlatinumGoldStandardLevelsid       int NOT NULL, 
  PRIMARY KEY (PlatinumGoldStandardSubscriptionid));
CREATE TABLE [Supplier] (
  supplycode int IDENTITY NOT NULL, 
  company    varchar(100) NOT NULL, 
  email      varchar(150) NOT NULL, 
  phone      varchar(20) NOT NULL, 
  [address]    varchar(100) NOT NULL, 
  country    varchar(100) NOT NULL, 
  postcode   varchar(5) NOT NULL, 
  city       varchar(100) NOT NULL, 
  PRIMARY KEY (supplycode));
CREATE TABLE [Supply Order] (
  orderno                     int IDENTITY NOT NULL, 
  Suppliersupplycode          int NOT NULL, 
  ExecutiveAdminEmployeeProfileid int NOT NULL, 
  Productid                   int NOT NULL, 
  Sensorid int,
  [date]                      date NOT NULL, 
  quantity                    int NOT NULL,  
  notes                       varchar(255) NULL, 
  PRIMARY KEY (orderno));
CREATE TABLE [Zone] (
  id          int IDENTITY NOT NULL, 
  coordinates varchar(20) NOT NULL, 
  climate     varchar(30) NOT NULL, 
  country     varchar(100) NOT NULL, 
  area        varchar(100) NOT NULL, 
  PRIMARY KEY (id));

